import './top-header.css'

const TopHeader = () => {
    return (
    <div className="top-header" style={{background:'black',padding:"5px 5px"}}>
    <marquee href="#" style={{ display:'block',color:'white', textTransform:'uppercase',letterSpacing:'1px',fontWeight:'500'}}>
    &#x2605; Shaik Sohail - Portfolio &#x2605; Shaik Sohail - Portfolio &#x2605; Shaik Sohail - Portfolio &#x2605; Shaik Sohail - Portfolio &#x2605; Shaik Sohail - Portfolio
    </marquee>
    </div>
    )
}

export default TopHeader
